import React from "react";
import "./styles.css";

const HeaderComponent = (password, email) => {
  return (
    <div className="footerLayout">
      <p className="font">Create an account</p>
      <button
        className="button"
        onCLick={() => {
          console.log(password, email);
        }}
      >
        LOGIN
      </button>
    </div>
  );
};

export default HeaderComponent;
